INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24001, 102301, "2020/07/31 12:00:00", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 2, 10046, 2, 401, 0.0, 24, "アヤネ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24002, 102301, "2020/07/31 12:00:00", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, 1, 10046, 2, 402, 2.21, 24, "アヤネ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24003, 102301, "2020/07/31 12:00:00", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 2, 10046, 2, 403, 0.0, 24, "アヤネ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24004, 192201, "2020/07/31 12:00:00", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, 2, 10046, 1, 701, 1.99, 24, "アサヒ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24005, 192201, "2020/07/31 12:00:00", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, 1, 10046, 2, 702, 2.21, 24, "アサヒ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24006, 192201, "2020/07/31 12:00:00", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, 2, 10046, 1, 703, 3.33, 24, "アサヒ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24007, 192301, "2020/07/31 12:00:00", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 2, 10046, 2, 801, 0.0, 24, "部員３", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24008, 192301, "2020/07/31 12:00:00", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, 1, 10046, 2, 802, 2.68, 24, "部員３", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24009, 192301, "2020/07/31 12:00:00", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 2, 10046, 2, 803, 0.0, 24, "部員３", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24010, 192501, "2020/07/31 12:00:00", "やった！", 0.0, 1, 10046, 1, 501, 0.0, 24, "", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24011, 192501, "2020/07/31 12:00:00", "勝ったよ！", 0.0, 1, 10046, 1, 502, 0.0, 24, "", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24012, 192501, "2020/07/31 12:00:00", "いい調子！", 0.0, 1, 10046, 1, 503, 0.0, 24, "", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24013, 113501, "2020/07/31 12:00:00", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, 6, 10046, 2, 111, 5.33, 24, "ミサト", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24014, 113501, "2020/07/31 12:00:00", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, 1, 10046, 2, 112, 6.85, 24, "ミサト", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24015, 113501, "2020/07/31 12:00:00", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, 1, 10046, 2, 113, 3.0, 24, "ミサト", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24016, 192401, "2020/07/31 12:00:00", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, 1, 10046, 2, 611, 6.11, 24, "ダイチ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24017, 192401, "2020/07/31 12:00:00", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, 1, 10046, 2, 612, 6.75, 24, "ダイチ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24018, 192401, "2020/07/31 12:00:00", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 2, 10046, 2, 613, 0.0, 24, "ダイチ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24019, 113401, "2020/07/31 12:00:00", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, 2, 10046, 1, 211, 4.52, 24, "ハツネ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24020, 113401, "2020/07/31 12:00:00", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, 2, 10046, 1, 212, 3.89, 24, "ハツネ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24021, 113401, "2020/07/31 12:00:00", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, 1, 10046, 2, 213, 13.49, 24, "ハツネ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24022, 106501, "2020/07/31 12:00:00", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, 1, 10046, 2, 311, 3.17, 24, "カヤ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24023, 106501, "2020/07/31 12:00:00", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, 1, 10046, 2, 312, 4.42, 24, "カヤ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24024, 106501, "2020/07/31 12:00:00", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, 6, 10046, 1, 313, 2.89, 24, "カヤ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24025, 102301, "2020/07/31 12:00:00", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, 4, 10046, 3, 421, 3.71, 24, "アヤネ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24026, 192201, "2020/07/31 12:00:00", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, 2, 10046, 1, 721, 5.1, 24, "アサヒ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24027, 192301, "2020/07/31 12:00:00", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, 1, 10046, 3, 821, 4.34, 24, "部員３", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24028, 192501, "2020/07/31 12:00:00", "いい勝負だったよ\nまたやろうね", 0.0, 1, 10046, 1, 521, 0.0, 24, "", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24029, 113501, "2020/07/31 12:00:00", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", -360.0, 1, 10046, 2, 101, 5.62, 24, "ミサト", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24030, 113501, "2020/07/31 12:00:00", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", -360.0, 1, 10046, 2, 102, 9.58, 24, "ミサト", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24031, 113501, "2020/07/31 12:00:00", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", -360.0, 2, 10046, 2, 103, 0.0, 24, "ミサト", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24032, 113501, "2020/07/31 12:00:00", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", -360.0, 2, 10046, 1, 104, 9.13, 24, "ミサト", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("2030/12/17 14:59:59", 24033, 113501, "2020/07/31 12:00:00", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", -360.0, 1, 10046, 2, 105, 8.27, 24, "ミサト", 0.0);
